import React from "react";

function App() {
  return (
    <div className="App">
      <h1> Hello World</h1>
      <h2> Hello World</h2>
      <h3> Hello World</h3>
      <h4> Hello World</h4>
      <h5> Hello World</h5>
      <h6> Hello World</h6>
      <hr />
      <code>const a = 'b'</code>
    </div>
  );
}

export default App;
